import React from "react";
import Header from "./Header";
import Order from "./Order";
import Inventory from "./Inventory";

function App() {
  return (
    <div className="catch-of-the-day">
      <div className="menu">
        <Header tagline="Wes is cool" />
      </div>
      <Inventory />
      <Order />
    </div>
  );
}

export default App;
